def extract_utilization(data_string):
    lens = []
    
    # Regular expressions for extracting the desired data
    len_pattern = re.compile(r'Len: (\d+\.\d{9})')

    # Split the data string into lines and process each line
    for line in data_string.split("\n"):
        # Extract queue size
        match = len_pattern.search(line)
        if match:
          lens.append(match.group(1))

    lens = [float(i) for i in lens]

    # Below is the part to extract first start time and last finish time

    # Split the data into lines
    lines = data_string.strip().split("\n")

    # Extract the sent time from the first line
    sent_time_first = float(lines[0].split("Sent:")[1].split()[0])

    # Extract the recv time from the last line
    recv_time_last = float(lines[-1].split("Recv:")[1].split()[0])

    utilization = sum(lens)/(recv_time_last-sent_time_first)

    return utilization

# Copied from eval1ef.py
def avg_resp_time(text):
  pattern = re.compile(r"Sent: (\d+\.\d+) Recv: (\d+\.\d+)")
      
  matches = pattern.findall(text)

  resp_time = [float(recv) - float(sent) for sent, recv in matches]

  avg_resp = sum(resp_time) / len(resp_time)

  return avg_resp


